import React, { useState } from 'react';
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogActions from '@mui/material/DialogActions';
import Checkbox from '@mui/material/Checkbox';
import FormControlLabel from '@mui/material/FormControlLabel';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Autoplay } from 'swiper/modules';
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';
import './Background.css';
import 'swiper/css/autoplay';
import image1 from '../../assets/img1.png';
import image2 from '../../assets/img2.png';
import image3 from '../../assets/img3.png';
import image4 from '../../assets/img4.png';
import image5 from '../../assets/img5.jpeg';
import Swal from 'sweetalert2';

const images = [image1, image2, image3, image4, image5];

const Background = () => {
  const [open, setOpen] = useState(false);
  const [option1, setOption1] = useState(false);
  const [option2, setOption2] = useState(false);
  const [option3, setOption3] = useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleOption1Change = (event) => {
    setOption1(event.target.checked);
  };

  const handleOption2Change = (event) => {
    setOption2(event.target.checked);
  };

  const handleOption3Change = (event) => {
    setOption3(event.target.checked);
  };

  const handleModalButtonClick = () => {
    handleClose();
    handleClick();
  };

  const handleClick = () => {
    let selectedOptions = [];
    if (option1) selectedOptions.push("Option 1");
    if (option2) selectedOptions.push("Option 2");
    if (option3) selectedOptions.push("Option 3");

    Swal.fire({
      background:"#0e0e1a",
      color:"white",
      title: "Selected Options",
      text: selectedOptions.join(", "),
      icon: "info"
    });
  };

  const LeftSection = () => (
    <div className="left-section">
      <div>
        <h3>State of the Art Technology</h3>
        <p>Our image prediction service utilizes cutting-edge machine learning algorithms to analyze and predict the content of images with unparalleled accuracy.
        Powered by deep learning models, our system can identify objects, scenes, and even complex patterns in images, providing valuable insights and enhancing your understanding of visual data.
        </p>
      </div>
      <a href="#" className="btn" onClick={handleClickOpen}><span>Start Predict</span></a>
    </div>
  );

  const RightSection = () => (
    <div className="right-section">
      <Swiper
        modules={[Autoplay]}
        slidesPerView={1}
        autoplay={{ delay: 1000 }}
      >
        {images.map((image, index) => (
          <SwiperSlide key={index}>
            <img className="img slide-img" src={image} alt="" />
          </SwiperSlide>
        ))}
      </Swiper>
    </div>
  );

  return (
    <div className="containerBack">
      <LeftSection />
      <RightSection />
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Select Options</DialogTitle>
        <DialogContent>
          <FormControlLabel
            control={
              <Checkbox
                checked={option1}
                onChange={handleOption1Change}
                color="primary"
              />
            }
            label="Option 1"
          />
          <FormControlLabel
            control={
              <Checkbox
                checked={option2}
                onChange={handleOption2Change}
                color="primary"
              />
            }
            label="Option 2"
          />
          <FormControlLabel
            control={
              <Checkbox
                checked={option3}
                onChange={handleOption3Change}
                color="primary"
              />
            }
            label="Option 3"
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleModalButtonClick}>Confirm</Button>
        </DialogActions>
      </Dialog>
    </div>
  );
};

export default Background;
